import React from 'react';
import web from "../src/images/DnA.png";

import Common from './Common';

const About = () => {
    return(
    <>
       <Common name="About DanceNd Art" 
       sideimg={web} 
       visit="/contact" 
       btname="Contact Now"
        abt="Online Platform for Dancer and Artist"
        /> 
       
    </>
    )
}

export default About;
